package p0942

import (
	"testing"

	"github.com/stretchr/testify/suite"
)

type result struct {
	arg1   string
	target []int
}

var values = []result{
	{
		arg1:   "IDID",
		target: []int{0, 4, 1, 3, 2},
	},
	{
		arg1:   "III",
		target: []int{0, 1, 2, 3},
	},
	{
		arg1:   "DDI",
		target: []int{3, 2, 0, 1},
	},
	// {
	// 	arg1:   "",
	// 	target: []int{},
	// },
}

type p0942TestSuite struct {
	suite.Suite
}

func (s *p0942TestSuite) Test() {
	for _, v := range values {
		s.Equal(v.target, diStringMatch(v.arg1))
	}
}

func TestP0942TestSuite(t *testing.T) {
	s := &p0942TestSuite{}
	suite.Run(t, s)
}
